import React, {useEffect} from 'react';
import ReactGA from 'react-ga';
import Container from "./components/Container.js";
import Footer from "./components/Footer.js";
import CustomLogo from "./images/LogoWhite.jpg";
import Texts from "./pages/Texts.js";

import {
    BrowserRouter as Router, Switch, Route, Link
  } from 'react-router-dom';

function App() {

useEffect(() => {
  ReactGA.initialize('UA-211790415-1');
  ReactGA.pageview(window.location.pathname + window.location.search);
},[])

  return (
    <Router>
    <div className="container center">
        <nav className="menu">
          <img className="custom-logo" src={CustomLogo} alt="Custom Logo"></img>
            <div className="menu__right">

                <ul className="menu__list">
                    <li className="menu__list-item"><a className="menu__link menu__link--active" href="/">Music</a></li>
                    <li className="menu__list-item"><a className="menu__link" href="Container">Los Santeros</a></li>
                    <li className="menu__link"><Link className="menu__link" to="/texts">Texts</Link></li>
                    <li className="menu__list-item"><a className="menu__link" href="/">Services</a></li>
                </ul>
            </div>
        </nav>
    </div>
    <Switch>
    <Route path="/texts" exact>
      <Texts />
    </Route>
    </Switch>
      <Container  />
      <Footer a id="f"/>
    </Router>
  );
}

export default App;
